import React from 'react';
import cards from "./cards.json"

import Jumbotron from "./components/Jumbotron"
import Card from "./components/Card"

class App extends React.Component {
  state = {cards}

  shuffle() {
    console.log("Clicked")
  }

  render() {
    return (
      <div className="App">
        <Jumbotron />
        <div className="" onClick={this.shuffle}>
          {cards.map(card =>
            <Card
              image = {card.image}
              key = {card.id} />)}
        </div>
      </div>
    );
  }
}

export default App;
